import React from "react";

const About = () => {
  return (
    <div className="container">
      <h2>About Library Management System</h2>
      <p>
        This system helps manage books, users, and rentals efficiently.
        Users can browse books, rent them, and track returns.
      </p>
    </div>
  );
};

export default About;
